Thought:
The restrictions reveal the following:
- The guitarist cannot perform the fourth solo;
- The percussionist must perform before the keyboard player;
- The keyboard player performs after the violinist and before the guitarist;
Due to the restriction "The saxophonist performs a solo at some time after either the percussionist does or the trumpeter does, but not both." it is clear that one of them (either percussionist or trumpeter) must perform before the third solo, because the saxophonist has to play after one of them. Therefore, the third solo cannot be either by percussionist or trumpeter. However, the trumpeter is not one of the choices. Therefore, of the available choices, saxophonist cannot be the third because the saxophonist has to play after either percussionist or trumpeter. 
So, the answer is C: saxophonist.
Action: Answer("C")
